	(41, NULL, 'Aquisição de serviço de comunicação para execução de serviço da mesma natureza', 'Classificam-se neste código as aquisições de serviços de comunicação utilizados nas prestações de serviços da mesma natureza.', '1301', NULL),
	(42, NULL, 'Aquisição de serviço de comunicação por estabelecimento industrial', 'Classificam-se neste código as aquisições de serviços de comunicação utilizados por estabelecimento industrial. Também serão classificadas neste código as aquisições de serviços de comunicação utilizados por estabelecimento industrial de cooperativa.', '1302', NULL),
	(43, NULL, 'Aquisição de serviço de comunicação por estabelecimento comercial', 'Classificam-se neste código as aquisições de serviços de comunicação utilizados por estabelecimento comercial. Também serão classificadas neste código as aquisições de serviços de comunicação utilizados por estabelecimento comercial de cooperativa.', '1303', NULL),
	(44, NULL, 'Aquisição de serviço de comunicação por estabelecimento de prestador de serviço de transporte', 'Classificam-se neste código as aquisições de serviços de comunicação utilizados por estabelecimento prestador de serviço de transporte.', '1304', NULL),
	(45, NULL, 'Aquisição de serviço de comunicação por estabelecimento de geradora ou de distribuidora de energia elétrica', 'Classificam-se neste código as aquisições de serviços de comunicação utilizados por estabelecimento de geradora ou de distribuidora de energia elétrica.', '1305', NULL),
	(46, NULL, 'Aquisição de serviço de comunicação por estabelecimento de produtor rural', 'Classificam-se neste código as aquisições de serviços de comunicação utilizados por estabelecimento de produtor rural.', '1306', NULL),
	(47, NULL, 'AQUISIÇÕES DE SERVIÇOS DE TRANSPORTE', NULL, '1350', NULL),
	(48, NULL, 'Aquisição de serviço de transporte para execução de serviço da mesma natureza', 'Classificam-se neste código as aquisições de serviços de transporte utilizados nas prestações de serviços da mesma natureza.', '1351', NULL),
	(49, NULL, 'Aquisição de serviço de transporte por estabelecimento industrial', 'Classificam-se neste código as aquisições de serviços de transporte utilizados por estabelecimento industrial. Também serão classificadas neste código as aquisições de serviços de transporte utilizados por estabelecimento industrial de cooperativa.', '1352', NULL),
	(50, NULL, 'Aquisição de serviço de transporte por estabelecimento comercial', 'Classificam-se neste código as aquisições de serviços de transporte utilizados por estabelecimento comercial. Também serão classificadas neste código as aquisições de serviços de transporte utilizados por estabelecimento comercial de cooperativa.', '1353', NULL),
