	(83, NULL, 'CRÉDITOS E RESSARCIMENTOS DE ICMS', NULL, '1600', NULL),
	(84, NULL, 'Recebimento, por transferência, de crédito de ICMS', 'Classificam-se neste código os lançamentos destinados ao registro de créditos de ICMS, recebidos por transferência de outras empresas.', '1601', NULL),
	(85, NULL, 'Recebimento, por transferência, de saldo credor do ICMS, de outro estabelecimento da mesma empresa, para compensação de saldo devedor do imposto.', 'Lançamento destinado ao registro da transferência de saldo credor do ICMS, recebido de outro estabelecimento da mesma empresa, destinado à compensação do saldo devedor do estabelecimento, inclusive no caso de apuração centralizada do imposto.\r\n\r\n(NR Ajuste SINIEF 9/2003 – a partir 01.01.2004) (Decreto nº 26.174/2003)', '1602', NULL),
	(86, NULL, 'Ressarcimento de ICMS retido por substituição tributária', 'Lançamento destinado ao registro de ressarcimento de ICMS retido por substituição tributária à contribuinte substituído, efetuado pelo contribuinte substituto, ou, ainda, quando o ressarcimento for apropriado pelo próprio contribuinte substituído, nas hipóteses previstas na legislação aplicável.', '1603', NULL),
	(87, NULL, 'Lançamento do crédito relativo à compra de bem para o ativo imobilizado', 'Lançamento destinado ao registro da apropriação de crédito de bem do ativo imobilizado. (Dec.25.068/2003-EFEITOS A PARTIR DE 01.01.2003)', '1604', NULL),
	(88, NULL, 'Recebimento, por transferência, de saldo devedor do ICMS de outro estabelecimento da mesma empresa', 'Lançamento destinado ao registro da transferência de saldo devedor do ICMS, recebido de outro estabelecimento da mesma empresa, para efetivação da apuração centralizada do imposto. (ACR Ajuste SINIEF 03/2004) (DECRETO Nº 26.810/2004) (a partir de 01.01.2005)', '1605', NULL),
	(89, NULL, 'ENTRADAS DE COMBUSTÍVEIS, DERIVADOS OU NÃO DE PETRÓLEO, E LUBRIFICANTES (ACR Ajuste SINIEF 9/2003 - a partir 01.01.2004)', NULL, '1650', NULL),
	(90, NULL, 'Compra de combustível ou lubrificante para industrialização subseqüente', 'Compra de combustível ou lubrificante a ser utilizados em processo de industrialização do próprio produto. (ACR Ajuste SINIEF 9/2003 - a partir 01.01.2004)', '1651', NULL),
	(91, NULL, 'Compra de combustível ou lubrificante para comercialização', 'Compra de combustível ou lubrificante a ser comercializados. (ACR Ajuste SINIEF 9/2003 - a partir 01.01.2004)', '1652', NULL),
	(92, NULL, 'Compra de combustível ou lubrificante por consumidor ou usuário final', 'Compra de combustível ou lubrificante, a ser consumidos em processo de industrialização de outros produtos, na produção rural, na prestação de serviço ou por usuário final.\r\n\r\n(NR Ajuste SINIEF 05/2005) (Dec.28.868/2006 - Efeitos a partir de 01/01/2006, ficando facultada ao contribuinte a sua adoção para fatos geradores ocorridos no período de 01 de novembro a 31 de dezembro de 2005)', '1653', NULL),
	(93, NULL, 'Transferência de combustível ou lubrificante para industrialização', 'Entrada de combustível ou lubrificante, recebidos em transferência de outro estabelecimento da mesma empresa, para ser utilizados em processo de industrialização do próprio produto.(Decreto 26.174/2003)(efeitos a partir 01.01.2004)', '1658', NULL),
	(94, NULL, 'Transferência de combustível ou lubrificante para comercialização', 'Entrada de combustível ou lubrificante, recebidos em transferência de outro estabelecimento da mesma empresa, para ser comercializados. .(Decreto 26.174/2003) (efeitos a partir 01.01.2004)', '1659', NULL),
	(95, NULL, 'Devolução de venda de combustível ou lubrificante destinados à industrialização subseqüente', 'Devolução de venda de combustível ou lubrificante, cuja saída tenha sido classificada como \"Venda de combustível ou lubrificante destinados à industrialização subseqüente\". (Decreto 26.174/2003)(efeitos a partir 01.01.2004)', '1660', 'D'),
	(96, NULL, 'Devolução de venda de combustível ou lubrificante destinados à comercialização', 'Devolução de venda de combustível ou lubrificante, cuja saída tenha sido classificada como \"Venda de combustível ou lubrificante para comercialização\".(Decreto 26.174/2003)(efeitos a partir 01.01.2004).', '1661', 'D'),
	(97, NULL, 'Devolução de venda de combustível ou lubrificante destinados a consumidor ou usuário final', 'Devolução de venda de combustível ou lubrificante, cuja saída tenha sido classificada como \"Venda de combustível ou lubrificante por consumidor ou usuário final\"..(Decreto 26.174/2003)(efeitos a partir 01.01.2004)', '1662', 'D'),
	(98, NULL, 'Entrada de combustível ou lubrificante para armazenagem', 'Entrada de combustível ou lubrificante para armazenagem. .(Decreto 26.174/2003)(efeitos a partir 01.01.2004)', '1663', NULL),
	(99, NULL, 'Retorno de combustível ou lubrificante remetidos para armazenagem', 'Entrada, ainda que simbólica, por retorno de combustível ou lubrificante, remetidos para armazenagem. .(Decreto 26.174/2003)(efeitos a partir 01.01.2004)', '1664', NULL),
	(100, NULL, 'OUTRAS ENTRADAS DE MERCADORIAS OU AQUISIÇÕES DE SERVIÇOS', NULL, '1900', NULL),
	(101, NULL, 'Entrada para industrialização por encomenda', 'Classificam-se neste código as entradas de insumos recebidos para industrialização por encomenda de outra empresa ou de outro estabelecimento da mesma empresa.', '1901', NULL),
	(102, NULL, 'Retorno de mercadoria remetida para industrialização por encomenda', 'Classificam-se neste código o retorno dos insumos remetidos para industrialização por encomenda, incorporados ao produto final pelo estabelecimento industrializador.', '1902', NULL),
	(103, NULL, 'Entrada de mercadoria remetida para industrialização e não aplicada no referido processo', 'Classificam-se neste código as entradas em devolução de insumos remetidos para industrialização e não aplicados no referido processo.', '1903', NULL),
	(104, NULL, 'Retorno de remessa para venda fora do estabelecimento', 'Classificam-se neste código as entradas em retorno de mercadorias remetidas para venda fora do estabelecimento, inclusive por meio de veículos, e não comercializadas.', '1904', NULL),
	(105, NULL, 'Entrada de mercadoria recebida para depósito em depósito fechado ou armazém geral', 'Classificam-se neste código as entradas de mercadorias recebidas para depósito em depósito fechado ou armazém geral.', '1905', NULL),
	(106, NULL, 'Retorno de mercadoria remetida para depósito fechado ou armazém geral', 'Classificam-se neste código as entradas em retorno de mercadorias remetidas para depósito em depósito fechado ou armazém geral.', '1906', NULL),
	(107, NULL, 'Retorno simbólico de mercadoria remetida para depósito fechado ou armazém geral', 'Classificam-se neste código as entradas em retorno simbólico de mercadorias remetidas para depósito em depósito fechado ou armazém geral, quando as mercadorias depositadas tenham sido objeto de saída a qualquer título e que não tenham retornado ao estabelecimento depositante.', '1907', NULL),
	(108, NULL, 'Entrada de bem por conta de contrato de comodato', 'Classificam-se neste código as entradas de bens recebidos em cumprimento de contrato de comodato.', '1908', NULL),
	(109, NULL, 'Retorno de bem remetido por conta de contrato de comodato', 'Classificam-se neste código as entradas de bens recebidos em devolução após cumprido o contrato de comodato.', '1909', NULL),
