	(159, NULL, 'Devolução de produção do estabelecimento, remetida em transferência.', 'Devolução de produto industrializado ou produzido pelo estabelecimento e transferido para outro estabelecimento da mesma empresa.\r\n\r\n(NR Ajuste SINIEF 05/2005) (Dec. 28.868/2006 - Efeitos a partir de 01/01/2006, ficando facultada ao contribuinte a sua adoção para fatos geradores ocorridos no período de 01 de novembro a 31 de dezembro de 2005)', '2208', 'D'),
	(160, NULL, 'Devolução de mercadoria adquirida ou recebida de terceiros e remetida em transferência', 'Devolução de mercadoria adquirida ou recebida de terceiros, transferidas para outros estabelecimentos da mesma empresa.', '2209', 'D'),
	(161, NULL, 'COMPRAS DE ENERGIA ELÉTRICA', NULL, '2250', NULL),
	(162, NULL, 'Compra de energia elétrica para distribuição ou comercialização', 'Classificam-se neste código as compras de energia elétrica utilizada em sistema de distribuição ou comercialização. Também serão classificadas neste código as compras de energia elétrica por cooperativas para distribuição com seus cooperados.', '2251', NULL),
	(163, NULL, 'Compra de energia elétrica por estabelecimento industrial', 'Classificam-se neste código as compras de energia elétrica utilizada no processo de industrialização. Também serão classificadas neste código as compras de energia elétrica utilizada por estabelecimento industrial de cooperativa.', '2252', NULL),
	(164, NULL, 'Compra de energia elétrica por estabelecimento comercial', 'Classificam-se neste código as compras de energia elétrica utilizada por estabelecimento comercial. Também serão classificadas neste código as compras de energia elétrica utilizada por estabelecimento comercial de cooperativa.', '2253', NULL),
