	(175, NULL, 'Aquisição de serviço de comunicação por estabelecimento de produtor rural', 'Classificam-se neste código as aquisições de serviços de comunicação utilizados por estabelecimento de produtor rural.', '2306', NULL),
	(176, NULL, 'AQUISIÇÕES DE SERVIÇOS DE TRANSPORTE', NULL, '2350', NULL),
	(177, NULL, 'Aquisição de serviço de transporte para execução de serviço da mesma natureza', 'Classificam-se neste código as aquisições de serviços de transporte utilizados nas prestações de serviços da mesma natureza.', '2351', NULL),
	(178, NULL, 'Aquisição de serviço de transporte por estabelecimento industrial', 'Classificam-se neste código as aquisições de serviços de transporte utilizados por estabelecimento industrial. Também serão classificadas neste código as aquisições de serviços de transporte utilizados por estabelecimento industrial de cooperativa.', '2352', NULL),
	(179, NULL, 'Aquisição de serviço de transporte por estabelecimento comercial', 'Classificam-se neste código as aquisições de serviços de transporte utilizados por estabelecimento comercial. Também serão classificadas neste código as aquisições de serviços de transporte utilizados por estabelecimento comercial de cooperativa.', '2353', NULL),
	(180, NULL, 'Aquisição de serviço de transporte por estabelecimento de prestador de serviço de comunicação', 'Classificam-se neste código as aquisições de serviços de transporte utilizados por estabelecimento prestador de serviços de comunicação.', '2354', NULL),
