	(202, NULL, 'Transferência de bem do ativo imobilizado', 'Classificam-se neste código as entradas de bens destinados ao ativo imobilizado recebidos em transferência de outro estabelecimento da mesma empresa.', '2552', NULL),
	(203, NULL, 'Devolução de venda de bem do ativo imobilizado', 'Classificam-se neste código as devoluções de vendas de bens do ativo imobilizado, cujas saídas tenham sido classificadas no código 6.551 - Venda de bem do ativo imobilizado.', '2553', 'D'),
	(204, NULL, 'Retorno de bem do ativo imobilizado remetido para uso fora do estabelecimento', 'Classificam-se neste código as entradas por retorno de bens do ativo imobilizado remetidos para uso fora do estabelecimento, cujas saídas tenham sido classificadas no código 6.554 - Remessa de bem do ativo imobilizado para uso fora do estabelecimento.', '2554', NULL),
	(205, NULL, 'Entrada de bem do ativo imobilizado de terceiro, remetido para uso no estabelecimento', 'Classificam-se neste código as entradas de bens do ativo imobilizado de terceiros, remetidos para uso no estabelecimento.', '2555', NULL),
