	(210, NULL, 'ENTRADAS DE COMBUSTÍVEIS, DERIVADOS OU NÃO DE PETRÓLEO, E LUBRIFICANTES (ACR Ajuste SINIEF 9/2003)', '(ACR Ajuste SINIEF 05/2005) (Dec.28.868/2006 )', '2650', NULL),
