	(216, NULL, 'Devolução de venda de combustível ou lubrificante destinados à industrialização subseqüente', 'Devolução de venda de combustível ou lubrificante, cuja saída tenha sido classificada como \"Venda de combustível ou lubrificante destinados à industrialização subseqüente\".(a partir 01.01.2004 -  Decreto Nº 26.174 de 26/11/2003)', '2660', 'D'),
	(217, NULL, 'Devolução de venda de combustível ou lubrificante destinados à comercialização', 'Devolução de venda de combustível ou lubrificante, cuja saída tenha sido classificada como \"Venda de combustível ou lubrificante para comercialização\".(a partir 01.01.2004 -  Decreto Nº 26.174 de 26/11/2003)', '2661', 'D'),
	(218, NULL, 'Devolução de venda de combustível ou lubrificante destinados a consumidor ou usuário final', 'Devolução de venda de combustível ou lubrificante, cuja saída tenha sido classificada como \"Venda de combustível ou lubrificante por consumidor ou usuário final\".(a partir 01.01.2004 -  Decreto Nº 26.174 de 26/11/2003)', '2662', 'D'),
	(219, NULL, 'Entrada de combustível ou lubrificante para armazenagem', 'Entrada de combustível ou lubrificante para armazenagem. (a partir 01.01.2004 -  Decreto Nº 26.174 de 26/11/2003)', '2663', NULL),
