	(236, NULL, 'Entrada de mercadoria ou bem recebido para conserto ou reparo', 'Classificam-se neste código as entradas de mercadorias ou bens recebidos para conserto ou reparo.', '2915', NULL),
	(237, NULL, 'Retorno de mercadoria ou bem remetido para conserto ou reparo', 'Classificam-se neste código as entradas em retorno de mercadorias ou bens remetidos para conserto ou reparo.', '2916', NULL),
	(238, NULL, 'Entrada de mercadoria recebida em consignação mercantil ou industrial', 'Classificam-se neste código as entradas de mercadorias recebidas a título de consignação mercantil ou industrial.', '2917', NULL),
	(239, NULL, 'Devolução de mercadoria remetida em consignação mercantil ou industrial', 'Classificam-se neste código as entradas por devolução de mercadorias remetidas anteriormente a título de consignação mercantil ou industrial.', '2918', 'D'),
	(240, NULL, 'Devolução simbólica de mercadoria vendida ou utilizada em processo industrial, remetida anteriormente em consignação mercantil ou industrial', 'Classificam-se neste código as entradas por devolução simbólica de mercadorias vendidas ou utilizadas em processo industrial, remetidas anteriormente a título de consignação mercantil ou industrial.', '2919', 'D'),
	(241, NULL, 'Entrada de vasilhame ou sacaria', 'Classificam-se neste código as entradas de vasilhame ou sacaria.', '2920', NULL),
