	(243, NULL, 'Lançamento efetuado a título de simples faturamento decorrente de compra para recebimento futuro', 'Classificam-se neste código os registros efetuados a título de simples faturamento decorrente de compra para recebimento futuro.', '2922', NULL),
	(244, NULL, 'Entrada de mercadoria recebida do vendedor remetente, em venda à ordem', 'Classificam-se neste código as entradas de mercadorias recebidas do vendedor remetente, em vendas à ordem, cuja compra do adquirente originário, foi classificada nos códigos 2.120 - Compra para industrialização, em venda à ordem, já recebida do vendedor remetente ou 2.121 - Compra para comercialização, em venda à ordem, já recebida do vendedor remetente.', '2923', NULL),
	(245, NULL, 'Entrada para industrialização por conta e ordem do adquirente da mercadoria, quando esta não transitar pelo estabelecimento do adquirente', 'Classificam-se neste código as entradas de insumos recebidos para serem industrializados por conta e ordem do adquirente, nas hipóteses em que os insumos não tenham transitado pelo estabelecimento do adquirente dos mesmos.', '2924', NULL),
	(246, NULL, 'Retorno de mercadoria remetida para industrialização por conta e ordem do adquirente da mercadoria, quando esta não transitar pelo estabelecimento do adquirente', 'Classificam-se neste código o retorno dos insumos remetidos por conta e ordem do adquirente, para industrialização e incorporados ao produto final pelo estabelecimento industrializador, nas hipóteses em que os insumos não tenham transitado pelo estabelecimento do adquirente.', '2925', NULL),
	(247, NULL, 'Lançamento efetuado pelo tomador do serviço de transporte, quando a responsabilidade de retenção do imposto for atribuída ao remetente ou alienante da mercadoria, pelo serviço de transporte realizado ', 'Lançamento efetuado pelo tomador do serviço de transporte realizado por transportador autônomo ou por transportador não-inscrito na Unidade da Federação onde se tenha iniciado o serviço, quando a responsabilidade pela retenção do imposto for atribuída ao remetente ou alienante da mercadoria.\r\n\r\n (ACR Ajuste SINIEF 03/2004) (DECRETO Nº 26.810/2004) (a partir de 01.01.2005)', '2931', NULL),
	(248, NULL, 'Aquisição de serviço de transporte iniciado em Unidade da Federação diversa daquela onde esteja inscrito o prestador', 'Aquisição de serviço de transporte que tenha sido iniciado em Unidade da Federação diversa daquela onde o prestador esteja inscrito como contribuinte. (ACR Ajuste SINIEF 03/2004) (DECRETO Nº 26.810/2004) (a partir de 01.01.2005)', '2932', NULL),
	(249, NULL, 'Aquisição de serviço tributado pelo Imposto Sobre Serviços de Qualquer Natureza', 'Aquisição de serviço, cujo imposto é de competência municipal, desde que informado em Nota Fiscal modelo 1 e 1-A. (NR Ajuste SINIEF 06/2005) (a partir de 01.01.2006)', '2933', NULL),
	(250, NULL, 'Outra entrada de mercadoria ou prestação de serviço não especificado', 'Classificam-se neste código as outras entradas de mercadorias ou prestações de serviços que não tenham sido especificados nos códigos anteriores.', '2949', NULL),
	(251, NULL, 'ENTRADAS OU AQUISIÇÕES DE SERVIÇOS DO EXTERIOR', 'Classificam-se, neste grupo, as entradas de mercadorias oriundas de outro país, inclusive as decorrentes de aquisição por arrematação, concorrência ou qualquer outra forma de alienação promovida pelo poder público, e os serviços iniciados no exterior', '3000', NULL),
	(252, NULL, 'COMPRAS PARA INDUSTRIALIZAÇÃO, PRODUÇÃO RURAL, COMERCIALIZAÇÃO OU PRESTAÇÃO DE SERVIÇOS (NR Ajuste SINIEF 05/2005) (Decreto 28.868/2006)', '(NR Ajuste SINIEF 05/2005) (Dec.28.868/2006 - Efeitos a partir de 01/01/2006, ficando facultada ao contribuinte a sua adoção para fatos geradores ocorridos no período de 01 de novembro a 31 de dezembro de 2005)', '3100', NULL),
	(253, NULL, 'Compra para industrialização ou produção rural (NR Ajuste SINIEF 05/2005) (Decreto 28.868/2006)', 'Compra de mercadoria a ser utilizada em processo de industrialização ou produção rural, bem como a entrada de mercadoria em estabelecimento industrial ou produtor rural de cooperativa.\r\n(NR Ajuste SINIEF 05/2005) (Dec.28.868/2006 - Efeitos a partir de 01/01/2006, ficando facultada ao contribuinte a sua adoção para fatos geradores ocorridos no período de 01 de novembro a 31 de dezembro de 2005)', '3101', NULL),
	(254, NULL, 'Compra para comercialização', 'Classificam-se neste código as compras de mercadorias a serem comercializadas. Também serão classificadas neste código as entradas de mercadorias em estabelecimento comercial de cooperativa.', '3102', NULL),
	(255, NULL, 'Compra para utilização na prestação de serviço', 'Classificam-se neste código as entradas de mercadorias a serem utilizadas nas prestações de serviços.', '3126', NULL),
	(256, NULL, 'Compra para industrialização sob o regime de drawback', 'Classificam-se neste código as compras de mercadorias a serem utilizadas em processo de industrialização e posterior exportação do produto resultante, cujas vendas serão classificadas no código 7.127 - Venda de produção do estabelecimento sob o regime de drawback.', '3127', NULL),
	(257, NULL, 'DEVOLUÇÕES DE VENDAS DE PRODUÇÃO PRÓPRIA, DE TERCEIROS OU ANULAÇÕES DE VALORES', NULL, '3200', NULL),
	(258, NULL, 'Devolução de venda de produção do estabelecimento', 'Devolução de venda de produto industrializado ou produzido pelo próprio estabelecimento, cuja saída tenha sido classificada como \"Venda de produção do estabelecimento\".\r\n\r\n(NR Ajuste SINIEF 05/2005) (Dec.28.868/2006 - Efeitos a partir de 01/01/2006, ficando facultada ao contribuinte a sua adoção para fatos geradores ocorridos no período de 01 de novembro a 31 de dezembro de 2005)', '3201', 'D'),
	(259, NULL, 'Devolução de venda de mercadoria adquirida ou recebida de terceiros', 'Classificam-se neste código as devoluções de vendas de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de industrialização no estabelecimento, cujas saídas tenham sido classificadas como Venda de mercadoria adquirida ou recebida de terceiros.', '3202', 'D'),
	(260, NULL, 'Anulação de valor relativo à prestação de serviço de comunicação', 'Classificam-se neste código as anulações correspondentes a valores faturados indevidamente, decorrentes de prestações de serviços de comunicação.', '3205', NULL),
	(261, NULL, 'Anulação de valor relativo à prestação de serviço de transporte', 'Classificam-se neste código as anulações correspondentes a valores faturados indevidamente, decorrentes de prestações de serviços de transporte.', '3206', NULL),
	(262, NULL, 'Anulação de valor relativo à venda de energia elétrica', 'Classificam-se neste código as anulações correspondentes a valores faturados indevidamente, decorrentes de venda de energia elétrica.', '3207', NULL),
	(263, NULL, 'Devolução de venda de produção do estabelecimento sob o regime de drawback', 'Classificam-se neste código as devoluções de vendas de produtos industrializados pelo estabelecimento sob o regime de drawback.', '3211', 'D'),
	(264, NULL, 'COMPRAS DE ENERGIA ELÉTRICA', NULL, '3250', NULL),
	(265, NULL, 'Compra de energia elétrica para distribuição ou comercialização', 'Classificam-se neste código as compras de energia elétrica utilizada em sistema de distribuição ou comercialização. Também serão classificadas neste código as compras de energia elétrica por cooperativas para distribuição aos seus cooperados.', '3251', NULL),
	(266, NULL, 'Aquisição de serviço de comunicação para execução de serviço da mesma natureza', 'Classificam-se neste código as aquisições de serviços de comunicação utilizados nas prestações de serviços da mesma natureza.', '3301', NULL),
	(267, NULL, 'AQUISIÇÕES DE SERVIÇOS DE TRANSPORTE', NULL, '3350', NULL),
	(268, NULL, 'Aquisição de serviço de transporte para execução de serviço da mesma natureza', 'Classificam-se neste código as aquisições de serviços de transporte utilizados nas prestações de serviços da mesma natureza.', '3351', NULL),
	(269, NULL, 'Aquisição de serviço de transporte por estabelecimento industrial', 'Classificam-se neste código as aquisições de serviços de transporte utilizados por estabelecimento industrial. Também serão classificadas neste código as aquisições de serviços de transporte utilizados por estabelecimento industrial de cooperativa.', '3352', NULL),
	(270, NULL, 'Aquisição de serviço de transporte por estabelecimento comercial', 'Classificam-se neste código as aquisições de serviços de transporte utilizados por estabelecimento comercial. Também serão classificadas neste código as aquisições de serviços de transporte utilizados por estabelecimento comercial de cooperativa.', '3353', NULL),
	(271, NULL, 'Aquisição de serviço de transporte por estabelecimento de prestador de serviço de comunicação', 'Classificam-se neste código as aquisições de serviços de transporte utilizados por estabelecimento prestador de serviços de comunicação.', '3354', NULL),
	(272, NULL, 'Aquisição de serviço de transporte por estabelecimento de geradora ou de distribuidora de energia elétrica', 'Classificam-se neste código as aquisições de serviços de transporte utilizados por estabelecimento de geradora ou de distribuidora de energia elétrica.', '3355', NULL),
	(273, NULL, 'Aquisição de serviço de transporte por estabelecimento de produtor rural', 'Classificam-se neste código as aquisições de serviços de transporte utilizados por estabelecimento de produtor rural.', '3356', NULL),
	(274, NULL, 'ENTRADAS DE MERCADORIAS REMETIDAS COM FIM ESPECÍFICO DE EXPORTAÇÃO E EVENTUAIS DEVOLUÇÕES', NULL, '3500', NULL),
	(275, NULL, 'Devolução de mercadoria exportada que tenha sido recebida com fim específico de exportação', 'Classificam-se neste código as devoluções de mercadorias exportadas por trading company, empresa comercial exportadora ou outro estabelecimento do remetente, recebidas com fim específico de exportação, cujas saídas tenham sido classificadas no código 7.501 - Exportação de mercadorias recebidas com fim específico de exportação.', '3503', 'D'),
	(276, NULL, 'OPERAÇÕES COM BENS DE ATIVO IMOBILIZADO E MATERIAIS PARA USO OU CONSUMO', NULL, '3550', NULL),
	(277, NULL, 'Compra de bem para o ativo imobilizado', 'Classificam-se neste código as compras de bens destinados ao ativo imobilizado do estabelecimento.', '3551', NULL),
	(278, NULL, 'Devolução de venda de bem do ativo imobilizado', 'Classificam-se neste código as devoluções de vendas de bens do ativo imobilizado, cujas saídas tenham sido classificadas no código 7.551 - Venda de bem do ativo imobilizado.', '3553', 'D'),
	(279, NULL, 'Compra de material para uso ou consumo', 'Classificam-se neste código as compras de mercadorias destinadas ao uso ou consumo do estabelecimento.', '3556', NULL),
	(280, NULL, 'ENTRADAS DE COMBUSTÍVEIS, DERIVADOS OU NÃO DE PETRÓLEO, E LUBRIFICANTES', '(ACR Ajuste SINIEF 9/2003 - a partir 01.01.2004) (Decreto Nº 26.174 de 26/11/2003)', '3650', NULL),
	(281, NULL, 'Compra de combustível ou lubrificante para industrialização subseqüente', 'Compra de combustível ou lubrificante a ser utilizados em processo de industrialização do próprio produto. (a partir 01.01.2004 -  Decreto Nº 26.174 de 26/11/2003)', '3651', NULL),
	(282, NULL, 'Compra de combustível ou lubrificante para comercialização', 'Compra de combustível ou lubrificante a ser comercializados. (a partir 01.01.2004 -  Decreto Nº 26.174 de 26/11/2003)', '3652', NULL),
	(283, NULL, 'Compra de combustível ou lubrificante por consumidor ou usuário final', 'Compra de combustível ou lubrificante, a ser consumidos em processo de industrialização de outros produtos, na produção rural, na prestação de serviço ou por usuário final.\r\n\r\n(NR Ajuste SINIEF 05/2005) (Dec.28.868/2006 - Efeitos a partir de 01/01/2006, ficando facultada ao contribuinte a sua adoção para fatos geradores ocorridos no período de 01 de novembro a 31 de dezembro de 2005)', '3653', NULL),
	(284, NULL, 'OUTRAS ENTRADAS DE MERCADORIAS OU AQUISIÇÕES DE SERVIÇOS', NULL, '3900', NULL),
	(285, NULL, 'Lançamento efetuado a título de entrada de bem sob amparo de regime especial aduaneiro de admissão temporária', 'Lançamento efetuado a título de entrada de bem amparada por regime especial aduaneiro de admissão temporária. – (Decreto Nº 26.174 de 26/11/2003). a partir 01.01.2004   ', '3930', NULL),
	(286, NULL, 'Outra entrada de mercadoria ou prestação de serviço não especificado', 'Outra entrada de mercadoria ou prestação de serviço que não tenham sido especificada nos códigos anteriores. – (Decreto Nº 26.174 de 26/11/2003). a partir 01.01.2004  ', '3949', NULL),
	(287, NULL, 'SAÍDAS OU PRESTAÇÕES DE SERVIÇOS PARA O ESTADO', 'Classificam-se, neste grupo, as operações ou prestações em que o estabelecimento remetente esteja localizado na mesma unidade da Federação do destinatário.', '5000', NULL),
	(288, NULL, 'VENDAS DE PRODUÇÃO PRÓPRIA OU DE TERCEIROS', NULL, '5100', 'V'),
	(289, NULL, 'Venda de produção do estabelecimento', 'Venda de produto industrializado ou produzido pelo estabelecimento, bem como a de mercadoria por estabelecimento industrial ou produtor rural de cooperativa destinada a seus cooperados ou a estabelecimento de outra cooperativa.\n\n(NR Ajuste SINIEF 05/2005) (Dec.28.868/2006 - Efeitos a partir de 01/01/2006, ficando facultada ao contribuinte a sua adoção para fatos geradores ocorridos no período de 01 de novembro a 31 de dezembro de 2005)', '5101', 'V'),
	(290, NULL, 'Venda de mercadoria adquirida ou recebida de terceiros', 'Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros para industrialização ou comercialização, que não tenham sido objeto de qualquer processo industrial no estabelecimento. Também serão classificadas neste código as vendas de mercadorias por estabelecimento comercial de cooperativa destinadas a seus cooperados ou estabelecimento de outra cooperativa.', '5102', 'V'),
	(291, NULL, 'Venda de produção do estabelecimento efetuada fora do estabelecimento', 'Venda efetuada fora do estabelecimento, inclusive por meio de veículo, de produto industrializado ou produzido no estabelecimento.\r\n\r\n(NR Ajuste SINIEF 05/2005) (Dec.28.868/2006 - Efeitos a partir de 01/01/2006, ficando facultada ao contribuinte a sua adoção para fatos geradores ocorridos no período de 01 de novembro a 31 de dezembro de 2005)', '5103', 'V'),
	(292, NULL, 'Venda de mercadoria adquirida ou recebida de terceiros, efetuada fora do estabelecimento', 'Classificam-se neste código as vendas efetuadas fora do estabelecimento, inclusive por meio de veículo, de mercadorias adquiridas ou recebidas de terceiros para industrialização ou comercialização, que não tenham sido objeto de qualquer processo industrial no estabelecimento.', '5104', 'V'),
	(293, NULL, 'Venda de produção do estabelecimento que não deva por ele transitar', 'Classificam-se neste código as vendas de produtos industrializados no estabelecimento, armazenados em depósito fechado, armazém geral ou outro sem que haja retorno ao estabelecimento depositante.', '5105', 'V'),
	(294, NULL, 'Venda de mercadoria adquirida ou recebida de terceiros, que não deva por ele transitar', 'Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros para industrialização ou comercialização, armazenadas em depósito fechado, armazém geral ou outro, que não tenham sido objeto de qualquer processo industrial no estabelecimento sem que haja retorno ao estabelecimento depositante. Também serão classificadas neste código as vendas de mercadorias importadas, cuja saída ocorra do recinto alfandegado ou da repartição alfandegária onde se processou o desembaraço aduaneiro, com destino ao esta', '5106', 'V'),
	(295, NULL, 'Venda de produção do estabelecimento destinada à Zona Franca de Manaus ou Áreas de Livre Comércio', 'Venda de produto industrializado ou produzido pelo estabelecimento destinado à Zona Franca de Manaus ou Áreas de Livre Comércio.\r\n\r\n(NR Ajuste SINIEF 05/2005) (Dec.28.868/2006 - Efeitos a partir de 01/01/2006, ficando facultada ao contribuinte a sua adoção para fatos geradores ocorridos no período de 01 de novembro a 31 de dezembro de 2005)', '5109', 'V'),
	(296, NULL, 'Venda de mercadoria, adquirida ou recebida de terceiros, destinada à Zona Franca de Manaus ou Áreas de Livre Comercio, de que trata o Anexo do Convênio SINIEF s/n, de 15 de dezembro de 1970, que dispõ', 'Venda de mercadoria, adquirida ou recebida de terceiros, destinada à Zona Franca de Manaus ou Áreas de Livre Comércio, desde que alcançada pelos benefícios fiscais de que tratam o Decreto-Lei nº 288, de 28 de fevereiro de 1967, o Convênio ICM 65/88, de 06 de dezembro de 1988, o Convênio ICMS 36/97, de 23 de maio de 1997, e o Convênio ICMS 37/97, de 23 de maio de 1997. (NR Ajuste SINIEF 09/2004) (Decreto nº 26.955/2004) RETROAGINDO SEUS EFEITOS A 24.06.2004.', '5110', 'V'),
	(297, NULL, 'Venda de produção do estabelecimento remetida anteriormente em consignação industrial', 'Classificam-se neste código as vendas efetivas de produtos industrializados no estabelecimento remetidos anteriormente a título de consignação industrial.', '5111', 'V'),
	(298, NULL, 'Venda de mercadoria adquirida ou recebida de terceiros remetida anteriormente em consignação industrial', 'Classificam-se neste código as vendas efetivas de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de qualquer processo industrial no estabelecimento, remetidas anteriormente a título de consignação industrial.', '5112', 'V'),
	(299, NULL, 'Venda de produção do estabelecimento remetida anteriormente em consignação mercantil', 'Classificam-se neste código as vendas efetivas de produtos industrializados no estabelecimento remetidos anteriormente a título de consignação mercantil.', '5113', 'V'),
	(300, NULL, 'Venda de mercadoria adquirida ou recebida de terceiros remetida anteriormente em consignação mercantil', 'Classificam-se neste código as vendas efetivas de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de qualquer processo industrial no estabelecimento, remetidas anteriormente a título de consignação mercantil.', '5114', 'V'),
	(301, NULL, 'Venda de mercadoria adquirida ou recebida de terceiros, recebida anteriormente em consignação mercantil', 'Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros, recebidas anteriormente a título de consignação mercantil.', '5115', 'V'),
	(302, NULL, 'Venda de produção do estabelecimento originada de encomenda para entrega futura', 'Venda de produto industrializado ou produzido pelo estabelecimento, quando da saída real do produto, cujo faturamento tenha sido classificado no código \"5.922 – Lançamento efetuado a título de simples faturamento decorrente de venda para entrega futura\".\r\n\r\n(NR Ajuste SINIEF 05/2005) (Dec.28.868/2006 - Efeitos a partir de 01/01/2006, ficando facultada ao contribuinte a sua adoção para fatos geradores ocorridos no período de 01 de novembro a 31 de dezembro de 2005)', '5116', 'V'),
	(303, NULL, 'Venda de produção do estabelecimento entregue ao destinatário por conta e ordem do adquirente originário, em venda à ordem', 'Classificam-se neste código as vendas à ordem de produtos industrializados pelo estabelecimento, entregues ao destinatário por conta e ordem do adquirente originário.', '5118', 'V'),
	(304, NULL, 'Venda de mercadoria adquirida ou recebida de terceiros entregue ao destinatário por conta e ordem do adquirente originário, em venda à ordem', 'Classificam-se neste código as vendas à ordem de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de qualquer processo industrial no estabelecimento, entregues ao destinatário por conta e ordem do adquirente originário.', '5119', 'V'),
	(305, NULL, 'Venda de mercadoria adquirida ou recebida de terceiros entregue ao destinatário pelo vendedor remetente, em venda à ordem', 'Classificam-se neste código as vendas à ordem de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de qualquer processo industrial no estabelecimento, entregues pelo vendedor remetente ao destinatário, cuja compra seja classificada, pelo adquirente originário, no código 1.118 - Compra de mercadoria pelo adquirente originário, entregue pelo vendedor remetente ao destinatário, em venda à ordem.', '5120', 'V'),
	(306, NULL, 'Venda de produção do estabelecimento remetida para industrialização, por conta e ordem do adquirente, sem transitar pelo estabelecimento do adquirente', 'Classificam-se neste código as vendas de produtos industrializados no estabelecimento, remetidos para serem industrializados em outro estabelecimento, por conta e ordem do adquirente, sem que os produtos tenham transitado pelo estabelecimento do adquirente.', '5122', 'V'),
	(307, NULL, 'Venda de mercadoria adquirida ou recebida de terceiros remetida para industrialização, por conta e ordem do adquirente, sem transitar pelo estabelecimento do adquirente', 'Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de qualquer processo industrial no estabelecimento, remetidas para serem industrializadas em outro estabelecimento, por conta e ordem do adquirente, sem que as mercadorias tenham transitado pelo estabelecimento do adquirente.', '5123', 'V'),
	(308, NULL, 'Industrialização efetuada para outra empresa', 'Classificam-se neste código as saídas de mercadorias industrializadas para terceiros, compreendendo os valores referentes aos serviços prestados e os das mercadorias de propriedade do industrializador empregadas no processo industrial.', '5124', 'V'),
	(309, NULL, 'Industrialização efetuada para outra empresa quando a mercadoria recebida para utilização no processo de industrialização não transitar pelo estabelecimento adquirente da mercadoria', 'Classificam-se neste código as saídas de mercadorias industrializadas para outras empresas, em que as mercadorias recebidas para utilização no processo de industrialização não tenham transitado pelo estabelecimento do adquirente das mercadorias, compreendendo os valores referentes aos serviços prestados e os das mercadorias de propriedade do industrializador empregadas no processo industrial.', '5125', 'V'),
	(310, NULL, 'TRANSFERÊNCIAS DE PRODUÇÃO PRÓPRIA OU DE TERCEIROS', NULL, '5150', NULL),
	(311, NULL, 'Transferência de produção do estabelecimento', 'Transferência de produto industrializado ou produzido no estabelecimento para outro estabelecimento da mesma empresa.\r\n\r\n(NR Ajuste SINIEF 05/2005) (Dec.28.868/2006 - Efeitos a partir de 01/01/2006, ficando facultada ao contribuinte a sua adoção para fatos geradores ocorridos no período de 01 de novembro a 31 de dezembro de 2005)', '5151', NULL),
	(312, NULL, 'Transferência de mercadoria adquirida ou recebida de terceiros', 'Mercadoria adquirida ou recebida de terceiros para industrialização, comercialização ou utilização na prestação de serviço e que não tenha sido objeto de qualquer processo industrial no estabelecimento, transferida para outro estabelecimento da mesma empresa. A partir  10 de julho de 2003. (Decreto nº 26.020/2003)', '5152', NULL),
	(313, NULL, 'Transferência de energia elétrica', 'Classificam-se neste código as transferências de energia elétrica para outro estabelecimento da mesma empresa, para distribuição.', '5153', NULL),
	(314, NULL, 'Transferência de produção do estabelecimento, que não deva por ele transitar', 'Classificam-se neste código as transferências para outro estabelecimento da mesma empresa, de produtos industrializados no estabelecimento que tenham sido remetidos para armazém geral, depósito fechado ou outro, sem que haja retorno ao estabelecimento depositante.', '5155', NULL),
	(315, NULL, 'Transferência de mercadoria adquirida ou recebida de terceiros, que não deva por ele transitar', 'Classificam-se neste código as transferências para outro estabelecimento da mesma empresa, de mercadorias adquiridas ou recebidas de terceiros para industrialização ou comercialização, que não tenham sido objeto de qualquer processo industrial, remetidas para armazém geral, depósito fechado ou outro, sem que haja retorno ao estabelecimento depositante.', '5156', NULL),
	(316, NULL, 'DEVOLUÇÕES DE COMPRAS PARA INDUSTRIALIZAÇÃO, PRODUÇÃO RURAL, COMERCIALIZAÇÃO OU ANULAÇÕES DE VALORES (NR Ajuste SINIEF 05/2005) (Decreto 28.868/2006)', '(NR Ajuste SINIEF 05/2005) (Dec.28.868/2006 - Efeitos a partir de 01/01/2006, ficando facultada ao contribuinte a sua adoção para fatos geradores ocorridos no período de 01 de novembro a 31 de dezembro de 2005)', '5200', NULL),
	(317, NULL, 'Devolução de compra para industrialização ou produção rural (NR Ajuste SINIEF 05/2005) (Decreto 28.868/2006)', 'Devolução de mercadoria adquirida para ser utilizada em processo de industrialização ou produção rural, cuja entrada tenha sido classificada como \"1.101 - Compra para industrialização ou produção rural\".\r\n\r\n(NR Ajuste SINIEF 05/2005) (Dec.28.868/2006 - Efeitos a partir de 01/01/2006, ficando facultada ao contribuinte a sua adoção para fatos geradores ocorridos no período de 01 de novembro a 31 de dezembro de 2005)', '5201', 'D'),
	(318, NULL, 'Devolução de compra para comercialização', 'Classificam-se neste código as devoluções de mercadorias adquiridas para serem comercializadas, cujas entradas tenham sido classificadas como Compra para comercialização.', '5202', 'D'),
	(319, NULL, 'Anulação de valor relativo a aquisição de serviço de comunicação', 'Classificam-se neste código as anulações correspondentes a valores faturados indevidamente, decorrentes das aquisições de serviços de comunicação.', '5205', NULL),
	(320, NULL, 'Anulação de valor relativo a aquisição de serviço de transporte', 'Classificam-se neste código as anulações correspondentes a valores faturados indevidamente, decorrentes das aquisições de serviços de transporte.', '5206', NULL),
	(321, NULL, 'Anulação de valor relativo à compra de energia elétrica', 'Classificam-se neste código as anulações correspondentes a valores faturados indevidamente, decorrentes da compra de energia elétrica.', '5207', NULL),
	(322, NULL, 'Devolução de mercadoria recebida em transferência para industrialização ou produção rural', 'Devolução de mercadoria recebida em transferência de outro estabelecimento da mesma empresa, para ser utilizada em processo de industrialização ou produção rural.\r\n(NR Ajuste SINIEF 05/2005) (Dec.28.868/2006 - Efeitos a partir de 01/01/2006, ficando facultada ao contribuinte a sua adoção para fatos geradores ocorridos no período de 01 de novembro a 31 de dezembro de 2005)', '5208', 'D'),
	(323, NULL, 'Devolução de mercadoria recebida em transferência para comercialização', 'Classificam-se neste código as devoluções de mercadorias recebidas em transferência de outro estabelecimento da mesma empresa, para serem comercializadas.', '5209', 'D'),
	(324, NULL, 'Devolução de compra para utilização na prestação de serviço', 'Classificam-se neste código as devoluções de mercadorias adquiridas para utilização na prestação de serviços, cujas entradas tenham sido classificadas no código 1.126 - Compra para utilização na prestação de serviço.', '5210', 'D'),
	(325, NULL, 'VENDAS DE ENERGIA ELÉTRICA', NULL, '5250', NULL),
	(326, NULL, 'Venda de energia elétrica para distribuição ou comercialização', 'Classificam-se neste código as vendas de energia elétrica destinada à distribuição ou comercialização. Também serão classificadas neste código as vendas de energia elétrica destinada a cooperativas para distribuição aos seus cooperados.', '5251', 'V'),
	(327, NULL, 'Venda de energia elétrica para estabelecimento industrial', 'Classificam-se neste código as vendas de energia elétrica para consumo por estabelecimento industrial. Também serão classificadas neste código as vendas de energia elétrica destinada a estabelecimento industrial de cooperativa.', '5252', 'V'),
	(328, NULL, 'Venda de energia elétrica para estabelecimento comercial', 'Classificam-se neste código as vendas de energia elétrica para consumo por estabelecimento comercial. Também serão classificadas neste código as vendas de energia elétrica destinada a estabelecimento comercial de cooperativa.', '5253', 'V'),
	(329, NULL, 'Venda de energia elétrica para estabelecimento prestador de serviço de transporte', 'Classificam-se neste código as vendas de energia elétrica para consumo por estabelecimento de prestador de serviços de transporte.', '5254', 'V'),
	(330, NULL, 'Venda de energia elétrica para estabelecimento prestador de serviço de comunicação', 'Classificam-se neste código as vendas de energia elétrica para consumo por estabelecimento de prestador de serviços de comunicação.', '5255', 'V'),
	(331, NULL, 'Venda de energia elétrica para estabelecimento de produtor rural', 'Classificam-se neste código as vendas de energia elétrica para consumo por estabelecimento de produtor rural.', '5256', 'V'),
	(332, NULL, 'Venda de energia elétrica para consumo por demanda contratada', 'Classificam-se neste código as vendas de energia elétrica para consumo por demanda contratada, que prevalecerá sobre os demais códigos deste subgrupo.', '5257', 'V'),
