	(400, NULL, 'Remessa para armazenagem de combustível ou lubrificante', 'Remessa para armazenagem de combustível ou lubrificante. (a partir 01.01.2004 -  Decreto Nº 26.174 de 26/11/2003)', '5663', 'V'),
	(401, NULL, 'Retorno de combustível ou lubrificante recebidos para armazenagem', 'Remessa, em devolução, de combustível ou lubrificante, recebidos para armazenagem. (a partir 01.01.2004 -  Decreto Nº 26.174 de 26/11/2003)', '5664', 'V'),
	(402, NULL, 'Retorno simbólico de combustível ou lubrificante recebidos para armazenagem', 'Retorno simbólico de combustível ou lubrificante, recebidos para armazenagem, quando a mercadoria armazenada tenha sido objeto de saída, a qualquer título, e não deva retornar ao estabelecimento depositante. (a partir 01.01.2004 -  Decreto Nº 26.174 de 26/11/2003)', '5665', 'V'),
	(403, NULL, 'Remessa, por conta e ordem de terceiros, de combustível ou lubrificante recebidos para armazenagem', 'Saída, por conta e ordem de terceiros, de combustível ou lubrificante, recebidos anteriormente para armazenagem. (a partir 01.01.2004 -  Decreto Nº 26.174 de 26/11/2003)', '5666', 'V'),
	(404, NULL, 'Venda de combustível ou lubrificante a consumidor ou usuário final estabelecido em outra Unidade da Federação', 'Venda de combustível ou lubrificante a consumidor ou a usuário final estabelecido em outra Unidade da Federação, cujo abastecimento tenha sido efetuado na unidade da Federação do remetente. ACR Ajuste SINIEF 05/2009 – a partir de 01.07.2009)(Decreto nº 34.490/2009)', '5667', 'V'),
	(405, NULL, 'OUTRAS SAÍDAS DE MERCADORIAS OU PRESTAÇÕES DE SERVIÇOS', NULL, '5900', NULL),
	(406, NULL, 'Remessa para industrialização por encomenda', 'Classificam-se neste código as remessas de insumos remetidos para industrialização por encomenda, a ser realizada em outra empresa ou em outro estabelecimento da mesma empresa.', '5901', NULL),
	(407, NULL, 'Retorno de mercadoria utilizada na industrialização por encomenda', 'Classificam-se neste código as remessas, pelo estabelecimento industrializador, dos insumos recebidos para industrialização e incorporados ao produto final, por encomenda de outra empresa ou de outro estabelecimento da mesma empresa. O valor dos insumos nesta operação deverá ser igual ao valor dos insumos recebidos para industrialização.', '5902', NULL),
	(408, NULL, 'Retorno de mercadoria recebida para industrialização e não aplicada no referido processo', 'Classificam-se neste código as remessas em devolução de insumos recebidos para industrialização e não aplicados no referido processo.', '5903', NULL),
	(409, NULL, 'Remessa para venda fora do estabelecimento', 'Classificam-se neste código as remessas de mercadorias para venda fora do estabelecimento, inclusive por meio de veículos.', '5904', NULL),
	(410, NULL, 'Remessa para depósito fechado ou armazém geral', 'Classificam-se neste código as remessas de mercadorias para depósito em depósito fechado ou armazém geral.', '5905', NULL),
	(411, NULL, 'Retorno de mercadoria depositada em depósito fechado ou armazém geral', 'Classificam-se neste código os retornos de mercadorias depositadas em depósito fechado ou armazém geral ao estabelecimento depositante.', '5906', NULL),
	(412, NULL, 'Retorno simbólico de mercadoria depositada em depósito fechado ou armazém geral', 'Classificam-se neste código os retornos simbólicos de mercadorias recebidas para depósito em depósito fechado ou armazém geral, quando as mercadorias depositadas tenham sido objeto de saída a qualquer título e que não devam retornar ao estabelecimento depositante.', '5907', NULL),
	(413, NULL, 'Remessa de bem por conta de contrato de comodato', 'Classificam-se neste código as remessas de bens para o cumprimento de contrato de comodato.', '5908', NULL),
	(414, NULL, 'Retorno de bem recebido por conta de contrato de comodato', 'Classificam-se neste código as remessas de bens em devolução após cumprido o contrato de comodato.', '5909', NULL),
	(415, NULL, 'Remessa em bonificação, doação ou brinde', 'Classificam-se neste código as remessas de mercadorias a título de bonificação, doação ou brinde.', '5910', NULL),
	(416, NULL, 'Remessa de amostra grátis', 'Classificam-se neste código as remessas de mercadorias a título de amostra grátis.', '5911', NULL),
	(417, NULL, 'Remessa de mercadoria ou bem para demonstração', 'Classificam-se neste código as remessas de mercadorias ou bens para demonstração.', '5912', NULL),
	(418, NULL, 'Retorno de mercadoria ou bem recebido para demonstração', 'Classificam-se neste código as remessas em devolução de mercadorias ou bens recebidos para demonstração.', '5913', NULL),
	(419, NULL, 'Remessa de mercadoria ou bem para exposição ou feira', 'Classificam-se neste código as remessas de mercadorias ou bens para exposição ou feira.', '5914', NULL),
	(420, NULL, 'Remessa de mercadoria ou bem para conserto ou reparo', 'Classificam-se neste código as remessas de mercadorias ou bens para conserto ou reparo.', '5915', NULL),
	(421, NULL, 'Retorno de mercadoria ou bem recebido para conserto ou reparo', 'Classificam-se neste código as remessas em devolução de mercadorias ou bens recebidos para conserto ou reparo.', '5916', NULL),
	(422, NULL, 'Remessa de mercadoria em consignação mercantil ou industrial', 'Classificam-se neste código as remessas de mercadorias a título de consignação mercantil ou industrial.', '5917', NULL),
	(423, NULL, 'Devolução de mercadoria recebida em consignação mercantil ou industrial', 'Classificam-se neste código as devoluções de mercadorias recebidas anteriormente a título de consignação mercantil ou industrial.', '5918', 'D'),
	(424, NULL, 'Devolução simbólica de mercadoria vendida ou utilizada em processo industrial, recebida anteriormente em consignação mercantil ou industrial', 'Classificam-se neste código as devoluções simbólicas de mercadorias vendidas ou utilizadas em processo industrial, que tenham sido recebidas anteriormente a título de consignação mercantil ou industrial.', '5919', 'D'),
	(425, NULL, 'Remessa de vasilhame ou sacaria', 'Classificam-se neste código as remessas de vasilhame ou sacaria.', '5920', NULL),
	(426, NULL, 'Devolução de vasilhame ou sacaria', 'Classificam-se neste código as saídas por devolução de vasilhame ou sacaria.', '5921', 'D'),
	(427, NULL, 'Lançamento efetuado a título de simples faturamento decorrente de venda para entrega futura', 'Classificam-se neste código os registros efetuados a título de simples faturamento decorrente de venda para entrega futura.', '5922', NULL),
	(428, NULL, 'Remessa de mercadoria por conta e ordem de terceiros, em venda à ordem', 'Classificam-se neste código as saídas correspondentes à entrega de mercadorias por conta e ordem de terceiros, em vendas à ordem, cuja venda ao adquirente originário, foi classificada nos códigos 5.118 - Venda de produção do estabelecimento entregue ao destinatário por conta e ordem do adquirente originário, em venda à ordem ou 5.119', '5923', NULL),
	(429, NULL, 'Remessa para industrialização por conta e ordem do adquirente da mercadoria, quando esta não transitar pelo estabelecimento do adquirente', 'Classificam-se neste código as saídas de insumos com destino a estabelecimento industrializador, para serem industrializados por conta e ordem do adquirente, nas hipóteses em que os insumos não tenham transitado pelo estabelecimento do adquirente dos mesmos.', '5924', NULL),
	(430, NULL, 'Retorno de mercadoria recebida para industrialização por conta e ordem do adquirente da mercadoria, quando aquela não transitar pelo estabelecimento do adquirente', 'Classificam-se neste código as remessas, pelo estabelecimento industrializador, dos insumos recebidos, por conta e ordem do adquirente, para industrialização e incorporados ao produto final, nas hipóteses em que os insumos não tenham transitado pelo estabelecimento do adquirente. O valor dos insumos nesta operação deverá ser igual ao valor dos insumos recebidos para industrialização.', '5925', NULL),
	(431, NULL, 'Lançamento efetuado a título de reclassificação de mercadoria decorrente de formação de kit ou de sua desagregação', 'Classificam-se neste código os registros efetuados a título de reclassificação decorrente de formação de kit de mercadorias ou de sua desagregação.', '5926', NULL),
	(432, NULL, 'Lançamento efetuado a título de baixa de estoque decorrente de perda, roubo ou deterioração', 'Classificam-se neste código os registros efetuados a título de baixa de estoque decorrente de perda, roubou ou deterioração das mercadorias.', '5927', NULL),
	(433, NULL, 'Lançamento efetuado a título de baixa de estoque decorrente de perda, roubo ou deterioração', 'Classificam-se neste código os registros efetuados a título de baixa de estoque decorrente de perda, roubou ou deterioração das mercadorias.', '5928', NULL),
	(434, NULL, 'Lançamento efetuado em decorrência de emissão de documento fiscal relativo a operação ou prestação também registrada em equipamento Emissor de Cupom Fiscal - ECF', 'Classificam-se neste código os registros relativos aos documentos fiscais emitidos em operações ou prestações que também tenham sido registradas em equipamento Emissor de Cupom Fiscal - ECF.', '5929', NULL),
	(435, NULL, 'Lançamento efetuado em decorrência da responsabilidade de retenção do imposto por substituição tributária, atribuída ao remetente ou alienante da mercadoria, pelo serviço de transporte realizado por t', 'Classificam-se neste código exclusivamente os lançamentos efetuados pelo remetente ou alienante da mercadoria quando lhe for atribuída a responsabilidade pelo recolhimento do imposto devido pelo serviço de transporte realizado por transportador autônomo ou por transportador não inscrito na unidade da Federação onde iniciado o serviço.', '5931', NULL),
	(436, NULL, 'Prestação de serviço de transporte iniciada em unidade da Federação diversa daquela onde inscrito o prestador', 'Classificam-se neste código as prestações de serviço de transporte que tenham sido iniciadas em unidade da Federação diversa daquela onde o prestador está inscrito como contribuinte.', '5932', NULL),
	(437, NULL, 'Prestação de serviço tributado pelo Imposto Sobre Serviços de Qualquer Natureza', 'Prestação de serviço, cujo imposto é de competência municipal, desde que informado em Nota Fiscal modelo 1 ou 1-A. (NR Ajuste SINIEF 06/2005)a partir de 01/01/2006', '5933', NULL),
	(438, NULL, 'Outra saída de mercadoria ou prestação de serviço não especificado', 'Classificam-se neste código as outras saídas de mercadorias ou prestações de serviços que não tenham sido especificados nos códigos anteriores.', '5949', NULL),
	(439, NULL, 'SAÍDAS OU PRESTAÇÕES DE SERVIÇOS PARA OUTROS ESTADOS', 'Classificam-se, neste grupo, as operações ou prestações em que o estabelecimento remetente esteja localizado em unidade da Federação diversa daquela do destinatário', '6000', NULL),
	(440, NULL, 'Venda de produção do estabelecimento', 'Venda de produto industrializado ou produzido pelo estabelecimento, bem como a de mercadoria por estabelecimento industrial ou produtor rural de cooperativa destinada a seus cooperados ou a estabelecimento de outra cooperativa.\r\n\r\n(NR Ajuste SINIEF 05/2005) (Dec.28.868/2006 - Efeitos a partir de 01/01/2006, ficando facultada ao contribuinte a sua adoção para fatos geradores ocorridos no período de 01 de novembro a 31 de dezembro de 2005)', '6101', 'V'),
	(441, NULL, 'Venda de mercadoria adquirida ou recebida de terceiros', 'Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros para industrialização ou comercialização, que não tenham sido objeto de qualquer processo industrial no estabelecimento. Também serão classificadas neste código as vendas de mercadorias por estabelecimento comercial de cooperativa destinadas a seus cooperados ou estabelecimento de outra cooperativa.', '6102', 'V'),
	(442, NULL, 'Venda de produção do estabelecimento, efetuada fora do estabelecimento', 'venda efetuada fora do estabelecimento, inclusive por meio de veículo, de produto industrializado no estabelecimento.\r\n\r\n(NR Ajuste SINIEF 05/2005) (Dec.28.868/2006 - Efeitos a partir de 01/01/2006, ficando facultada ao contribuinte a sua adoção para fatos geradores ocorridos no período de 01 de novembro a 31 de dezembro de 2005)', '6103', 'V'),
	(443, NULL, 'Venda de mercadoria adquirida ou recebida de terceiros, efetuada fora do estabelecimento', 'venda efetuada fora do estabelecimento, inclusive por meio de veículo, de mercadoria adquirida ou recebida de terceiro para industrialização ou comercialização, que não tenha sido objeto de qualquer processo industrial no estabelecimento.', '6104', 'V'),
	(444, NULL, 'Venda de produção do estabelecimento que não deva por ele transitar', 'Classificam-se neste código as vendas de produtos industrializados no estabelecimento, armazenados em depósito fechado, armazém geral ou outro sem que haja retorno ao estabelecimento depositante.', '6105', 'V'),
	(445, NULL, 'Venda de mercadoria adquirida ou recebida de terceiros, que não deva por ele transitar', 'Vendas de mercadoria adquirida ou recebida de terceiro para industrialização ou comercialização, armazenada em depósito fechado, armazém geral ou outro, que não tenha sido objeto de qualquer processo industrial no estabelecimento sem que haja retorno ao estabelecimento depositante. Bem como venda de mercadoria importada, cuja saída ocorra do recinto alfandegado ou da repartição alfandegária onde se processou o desembaraço aduaneiro, com destino ao estabelecimento do comprador, sem que tenha transitado pelo estabelecimento do', '6106', 'V'),
	(446, NULL, 'Venda de produção do estabelecimento, destinada a não contribuinte', 'Vendas de produto industrializado no estabelecimento, ou produzido no estabelecimento do produtor rural, destinada a não contribuinte, bem como qualquer operação de venda destinada a não contribuinte\r\n\r\n (NR Ajuste SINIEF 05/2005) (Dec.28.868/2006 - Efeitos a partir de 01/01/2006, ficando facultada ao contribuinte a sua adoção para fatos geradores ocorridos no período de 01 de novembro a 31 de dezembro de 2005)', '6107', 'V'),
	(447, NULL, 'Venda de mercadoria adquirida ou recebida de terceiros, destinada a não contribuinte', 'Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros para industrialização ou comercialização, que não tenham sido objeto de qualquer processo industrial no estabelecimento, destinadas a não contribuintes. Quaisquer operações de venda destinadas a não contribuintes deverão ser classificadas neste código.', '6108', 'V'),
	(448, NULL, 'Venda de produção do estabelecimento destinada à Zona Franca de Manaus ou Áreas de Livre Comércio', 'Venda de produto industrializado ou produzido pelo estabelecimento destinado à Zona Franca de Manaus ou Áreas de Livre Comércio.\r\n\r\n(NR Ajuste SINIEF 05/2005) (Dec.28.868/2006 - Efeitos a partir de 01/01/2006, ficando facultada ao contribuinte a sua adoção para fatos geradores ocorridos no período de 01 de novembro a 31 de dezembro de 2005)', '6109', 'V'),
	(449, NULL, 'Venda de mercadoria, adquirida ou recebida de terceiros, destinada à Zona Franca de Manaus ou Áreas de Livre Comércio, de que trata o Anexo do Convênio SINIEF s/n, de 15 de dezembro de 1970, que dispõ', 'Venda de mercadoria, adquirida ou recebida de terceiros, destinada à Zona Franca de Manaus ou Áreas de Livre Comércio, desde que alcançada pelos benefícios fiscais de que tratam o Decreto-Lei nº 288, de 28 de fevereiro de 1967, o Convênio ICM 65/88, de 06 de dezembro de 1988, o Convênio ICMS 36/97, de 23 de maio de 1997, e o Convênio ICMS 37/97, de 23 de maio de 1997. (NR Ajuste SINIEF 09/2004) (Decreto nº 26.955/2004) RETROAGINDO SEUS EFEITOS A 24.06.2004', '6110', 'V'),
	(450, NULL, 'Venda de produção do estabelecimento remetida anteriormente em consignação industrial', 'Classificam-se neste código as vendas efetivas de produtos industrializados no estabelecimento remetidos anteriormente a título de consignação industrial.', '6111', 'V'),
	(451, NULL, 'Venda de mercadoria adquirida ou recebida de Terceiros remetida anteriormente em consignação industrial', 'Classificam-se neste código as vendas efetivas de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de qualquer processo industrial no estabelecimento, remetidas anteriormente a título de consignação industrial.', '6112', 'V'),
	(452, NULL, 'Venda de produção do estabelecimento remetida anteriormente em consignação mercantil', 'Classificam-se neste código as vendas efetivas de produtos industrializados no estabelecimento remetidos anteriormente a título de consignação mercantil.', '6113', 'V'),
	(453, NULL, 'Venda de mercadoria adquirida ou recebida de terceiros remetida anteriormente em consignação mercantil', 'Classificam-se neste código as vendas efetivas de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de qualquer processo industrial no estabelecimento, remetidas anteriormente a título de consignação mercantil.', '6114', 'V'),
	(454, NULL, 'Venda de mercadoria adquirida ou recebida de terceiros, recebida anteriormente em consignação mercantil', 'Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros, recebidas anteriormente a título de consignação mercantil.', '6115', 'V'),
	(455, NULL, 'Venda de produção do estabelecimento originada de encomenda para entrega futura', 'Venda de produto industrializado ou produzido pelo estabelecimento, quando da saída real do produto, cujo faturamento tenha sido classificado no código \"5.922 – Lançamento efetuado a título de simples faturamento decorrente de venda para entrega futura\".\r\n\r\n(NR Ajuste SINIEF 05/2005) (Dec.28.868/2006 - Efeitos a partir de 01/01/2006, ficando facultada ao contribuinte a sua adoção para fatos geradores ocorridos no período de 01 de novembro a 31 de dezembro de 2005)', '6116', 'V'),
	(456, NULL, 'Venda de mercadoria adquirida ou recebida de terceiros, originada de encomenda para entrega futura', 'Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de qualquer processo industrial no estabelecimento, quando da saída real da mercadoria, cujo faturamento tenha sido classificado no código 6.922 - Lançamento efetuado a título de simples faturamento decorrente de venda para entrega futura.', '6117', 'V'),
	(457, NULL, 'Venda de produção do estabelecimento entregue ao destinatário por conta e ordem do adquirente originário, em venda à ordem', 'Classificam-se neste código as vendas à ordem de produtos industrializados pelo estabelecimento, entregues ao destinatário por conta e ordem do adquirente originário.', '6118', 'V'),
	(458, NULL, 'Venda de mercadoria adquirida ou recebida de terceiros entregue ao destinatário por conta e ordem do adquirente originário, em venda à ordem', 'Classificam-se neste código as vendas à ordem de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de qualquer processo industrial no estabelecimento, entregues ao destinatário por conta e ordem do adquirente originário.', '6119', 'V'),
	(459, NULL, 'Venda de mercadoria adquirida ou recebida de terceiros entregue ao destinatário pelo vendedor remetente, em venda à ordem', 'Classificam-se neste código as vendas à ordem de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de qualquer processo industrial no estabelecimento, entregues pelo vendedor remetente ao destinatário, cuja compra seja classificada, pelo adquirente originário, no código 2.118 - Compra de mercadoria pelo adquirente originário, entregue pelo vendedor remetente ao destinatário, em venda à ordem.', '6120', 'V'),
	(460, NULL, 'Venda de produção do estabelecimento remetida para industrialização, por conta e ordem do adquirente, sem transitar pelo estabelecimento do adquirente', 'Classificam-se neste código as vendas de produtos industrializados no estabelecimento, remetidos para serem industrializados em outro estabelecimento, por conta e ordem do adquirente, sem que os produtos tenham transitado pelo estabelecimento do adquirente.', '6122', 'V'),
	(461, NULL, 'Venda de mercadoria adquirida ou recebida de terceiros remetida para industrialização, por conta e ordem do adquirente, sem transitar pelo estabelecimento do adquirente', 'Classificam-se neste código as vendas de mercadorias adquiridas ou recebidas de terceiros, que não tenham sido objeto de qualquer processo industrial no estabelecimento, remetidas para serem industrializadas em outro estabelecimento, por conta e ordem do adquirente, sem que as mercadorias tenham transitado pelo estabelecimento do adquirente.', '6123', 'V'),
	(462, NULL, 'Industrialização efetuada para outra empresa', 'Classificam-se neste código as saídas de mercadorias industrializadas para terceiros, compreendendo os valores referentes aos serviços prestados e os das mercadorias de propriedade do industrializador empregadas no processo industrial.', '6124', 'V'),
	(463, NULL, 'Industrialização efetuada para outra empresa quando a mercadoria recebida para utilização no processo de industrialização não transitar pelo estabelecimento adquirente da mercadoria', 'Classificam-se neste código as saídas de mercadorias industrializadas para outras empresas, em que as mercadorias recebidas para utilização no processo de industrialização não tenham transitado pelo estabelecimento do adquirente das mercadorias, compreendendo os valores referentes aos serviços prestados e os das mercadorias de propriedade do industrializador empregadas no processo industrial.', '6125', 'V'),
	(464, NULL, 'TRANSFERÊNCIAS DE PRODUÇÃO PRÓPRIA OU DE TERCEIROS', NULL, '6150', NULL),
	(465, NULL, 'Transferência de produção do estabelecimento', 'Produtos industrializado ou produzido no estabelecimento e transferido para outro estabelecimento da mesma empresa.\r\n\r\n(NR Ajuste SINIEF 05/2005) (Dec.28.868/2006 - Efeitos a partir de 01/01/2006, ficando facultada ao contribuinte a sua adoção para fatos geradores ocorridos no período de 01 de novembro a 31 de dezembro de 2005)', '6151', NULL),
	(466, NULL, 'Transferência de mercadoria adquirida ou recebida de terceiros', 'Mercadoria adquirida ou recebida de terceiros para industrialização, comercialização ou utilização na prestação de serviço e que não tenha sido objeto de qualquer processo industrial no estabelecimento, transferida para outro estabelecimento da mesma empresa. A partir  10 de julho de 2003. (Decreto nº 26.020/2003)', '6152', NULL),
	(467, NULL, 'Transferência de energia elétrica', 'Classificam-se neste código as transferências de energia elétrica para outro estabelecimento da mesma empresa, para distribuição.', '6153', NULL),
	(468, NULL, 'Transferência de produção do estabelecimento, que não deva por ele transitar', 'Classificam-se neste código as transferências para outro estabelecimento da mesma empresa, de produtos industrializados no estabelecimento que tenham sido remetidos para armazém geral, depósito fechado ou outro, sem que haja retorno ao estabelecimento depositante.', '6155', NULL),
	(469, NULL, 'Transferência de mercadoria adquirida ou recebida de terceiros, que não deva por ele transitar', 'Classificam-se neste código as transferências para outro estabelecimento da mesma empresa, de mercadorias adquiridas ou recebidas de terceiros para industrialização ou comercialização, que não tenham sido objeto de qualquer processo industrial, remetidas para armazém geral, depósito fechado ou outro, sem que haja retorno ao estabelecimento depositante.', '6156', NULL),
	(470, NULL, 'DEVOLUÇÕES DE COMPRAS PARA INDUSTRIALIZAÇÃO, COMERCIALIZAÇÃO OU ANULAÇÕES DE VALORES', '(NR Ajuste SINIEF 05/2005) (Dec.28.868/2006 - Efeitos a partir de 01/01/2006, ficando facultada ao contribuinte a sua adoção para fatos geradores ocorridos no período de 01 de novembro a 31 de dezembro de 2005)', '6200', NULL),
	(471, NULL, 'Devolução de compra para industrialização ou produção rural (NR Ajuste SINIEF 05/2005) (Decreto 28.868/2006)', 'Devolução de mercadoria adquirida para ser utilizada em processo de industrialização ou produção rural, cuja entrada tenha sido classificada como \"1.101 - Compra para industrialização ou produção rural\".\r\n\r\n(NR Ajuste SINIEF 05/2005) (Dec.28.868/2006 - Efeitos a partir de 01/01/2006, ficando facultada ao contribuinte a sua adoção para fatos geradores ocorridos no período de 01 de novembro a 31 de dezembro de 2005)', '6201', 'D'),
