	(519, NULL, 'REMESSAS COM FIM ESPECÍFICO DE EXPORTAÇÃO E EVENTUAIS DEVOLUÇÕES', '(NR Ajuste SINIEF 05/2005) (Dec. 28.868/2006 - a sua aplicação será obrigatória em relação aos fatos geradores ocorridos a partir de 01 de julho de 2006, ficando facultada ao contribuinte a sua adoção para fatos geradores ocorridos no período de 01 de janeiro a 30 de junho de 2006)', '6500', 'V'),
	(520, NULL, 'Remessa de produção do estabelecimento, com fim específico de exportação', 'Saída de produto industrializado ou produzido pelo estabelecimento, remetido com fim específico de exportação a \"trading company\", empresa comercial exportadora ou outro estabelecimento do remetente.\r\n\r\n(NR Ajuste SINIEF 05/2005) (Dec. 28.868/2006 - a sua aplicação será obrigatória em relação aos fatos geradores ocorridos a partir de 01 de julho de 2006, ficando facultada ao contribuinte a sua adoção para fatos geradores ocorridos no período de 01 de janeiro a 30 de junho de 2006)', '6501', 'V'),
	(521, NULL, 'Remessa de mercadoria adquirida ou recebida de terceiros, com fim específico de exportação', 'Classificam-se neste código as saídas de mercadorias adquiridas ou recebidas de terceiros, remetidas com fim específico de exportação a trading company, empresa comercial exportadora ou outro estabelecimento do remetente.', '6502', 'V'),
